import React from "react";
//import "./Tokenomics.css";

const Tokenomics = () => {
  return (
    <section className="tokenomics">
  <h2>Tokenomics</h2>
  <p>
    <span>Token Symbol:</span> $FOXY
  </p>
  <p>
    <span>Total Supply:</span> 999,999,783.49
  </p>
  <p>
    <span>Fair Launch:</span> No team tokens, no presale
  </p>
</section>

  );
};

export default Tokenomics;
